import{_ as a,H as o,E as i,aj as t}from"./chunks/framework.CE5Mb3x2.js";const m=JSON.parse('{"title":"Next Admin 组件统计","description":"","frontmatter":{},"headers":[],"relativePath":"work/90.next-admin-search.md","filePath":"work/90.next-admin-search.md","lastUpdated":1765646621000}'),d={name:"work/90.next-admin-search.md"};function l(c,e,r,n,p,s){return i(),o("div",null,e[0]||(e[0]=[t('<div class="info custom-block"><p class="custom-block-title">作者</p><p>novlan1</p><p>2025.9.28</p></div><h1 id="next-admin-组件统计" tabindex="-1">Next Admin 组件统计 <a class="header-anchor" href="#next-admin-组件统计" aria-label="Permalink to &quot;Next Admin 组件统计&quot;">​</a></h1><p>地址：<a href="https://novlan1.github.io/docs/next-admin/component-statistics" target="_blank" rel="noreferrer">https://novlan1.github.io/docs/next-admin/component-statistics</a></p><h2 id="_1-搜索语法" tabindex="-1">1. 搜索语法 <a class="header-anchor" href="#_1-搜索语法" aria-label="Permalink to &quot;1. 搜索语法&quot;">​</a></h2><p>简单搜索，直接输入想搜的内容即可，如：</p><img src="https://mike-1255355338.cos.ap-guangzhou.myqcloud.com/article/2025/9/own_mike_zst6QiC2sMKAay22.png" width="600"><p>高级搜索，可以按字段搜索：</p><ul><li>搜索某组件库，如想搜素 <code>Press UI</code> 组件库，可以输入 <code>library:press-ui</code></li><li>搜索某项目，如想搜素 <code>gp-next</code> 项目，可以输入 <code>project:gp-next</code></li><li>搜索某组件，如想搜素 <code>press-list</code> 组件，可以输入 <code>component:press-list</code></li><li>多个字段搜索，可以使用分号连接，如 <code>library:press-ui;project:gp-next</code>，表示搜索使用 <code>press-ui</code> 组件库的 <code>gp-next</code> 项目</li></ul><img src="https://mike-1255355338.cos.ap-guangzhou.myqcloud.com/article/2025/9/own_mike_2B8BwGWmmJjssJdm.png" width="600"><h2 id="_2-faq" tabindex="-1">2. FAQ <a class="header-anchor" href="#_2-faq" aria-label="Permalink to &quot;2. FAQ&quot;">​</a></h2><h3 id="_2-1-统计方案" tabindex="-1">2.1. 统计方案 <a class="header-anchor" href="#_2-1-统计方案" aria-label="Permalink to &quot;2.1. 统计方案&quot;">​</a></h3><p>每天、每个组件库、每个项目、每个组件的使用数目是唯一的，设计了一个唯一 <code>key</code>，即 <code>${date}__${library}__${project}__${component}</code>。</p><p>录入数据的时候，先查询是否有该 <code>key</code>，如果有，则更新使用数目，如果没有，则新增。</p><h3 id="_2-2-统计项目" tabindex="-1">2.2. 统计项目 <a class="header-anchor" href="#_2-2-统计项目" aria-label="Permalink to &quot;2.2. 统计项目&quot;">​</a></h3><p>包含以下组的前端项目：</p><ul><li><code>pmd-mobile</code></li><li><code>pvpesports</code></li><li><code>coecology</code></li><li><code>slolnes</code></li></ul><p>排除了以下无效项目：</p><ul><li><code>pmd-mobile/{app,movie,hippy,tip-flutter,test,demo}/*</code></li><li><code>pmd-mobile/pmd-h5/api</code></li><li><code>pmd-mobile/pmd-h5/frontend-cloud</code></li><li>组件库自身项目</li></ul><h3 id="_2-3-统计分支" tabindex="-1">2.3. 统计分支 <a class="header-anchor" href="#_2-3-统计分支" aria-label="Permalink to &quot;2.3. 统计分支&quot;">​</a></h3><p>各项目的主分支，业务项目基本都是 <code>develop</code>。</p><h3 id="_2-4-统计起始日期" tabindex="-1">2.4. 统计起始日期 <a class="header-anchor" href="#_2-4-统计起始日期" aria-label="Permalink to &quot;2.4. 统计起始日期&quot;">​</a></h3><p>2025.9.26</p><h3 id="_2-5-统计意义" tabindex="-1">2.5. 统计意义 <a class="header-anchor" href="#_2-5-统计意义" aria-label="Permalink to &quot;2.5. 统计意义&quot;">​</a></h3><p>组件复用率越高，证明组件库的质量越高，通用性越强，稳定性越好。</p><p>提高组件复用率：</p><ul><li>对开发人员来说，可以减少重复开发，提高开发效率</li><li>对项目来说，既可以缩短工时，也可以提高项目质量</li></ul><p>统计和量化组件复用率，有利于对组件使用情况进行横向和纵向比较，直观、清晰。</p>',27)]))}const _=a(d,[["render",l]]);export{m as __pageData,_ as default};
